import React, { Component } from "react";

class LoadingComponent extends Component {
  constructor(props) {
    super(props);
    this.loadingTitle = `Statusas`;
    this.loadingText = `Kraunama ...`;
  }

  render() {
    return (
      <div className="col-lg-10 col-md-10 col-sm-12 col-xs-12 mx-auto align-items-center py-4 mb-4">
        <div className="card my-4">
          <div className="card-body">
            <h4 className="card-title">{this.loadingTitle}</h4>
            <p className="card-text"></p>
          </div>
        </div>
        <NetworkNavigator status={window.navigator.onLine} />
        <NavComponent />
      </div>
    );
  }
}

export default LoadingComponent;
